                    <span className="text-sm text-gray-500 dark:text-gray-300 sm:text-center">© 2023 <a href="https://flowbite.com/" className="hover:underline">Flowbite™</a>. All Rights Reserved.</span>
                    <div className="flex mt-4 sm:justify-center md:mt-0 space-x-5 rtl:space-x-reverse">
                        {/* Social Media Icons */}
                        <a href="#" className="text-gray-400 hover:text-gray-900 dark:hover:text-white">
                            {/* SVG for Facebook */}
                            {/* ... Other SVG icons */}
                        </a>
                        {/* ... Other social media links */}
                    </div>
                </div>
            </div>
        </footer>
    );
};



